import styled from "styled-components";

export const ButtonWrapper = styled.button`
line-height: 29px;
color: #333;
background-color: white;
border-radius: 20%;
border-color: white;
font-size: 18px;
margin: 0px;
text-transform: none;
font-weight: 600;
letter-spacing: 0px;
position: relative;
z-index: 11;
padding: 5px 25px;
        
`;
export const ButtonText = styled.h4`

        
`;
